  `risk_level` char(1) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT 'A' COMMENT '风险级别A、B、C',
  `post_level` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '职务等级',
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 11112651 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '用户信息表' ROW_FORMAT = Dynamic;

